package com.example.leetcode;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

/**
 * 
 * <pre>
给你一个字符串 s 、一个字符串 t 。返回 s 中涵盖 t 所有字符的最小子串。如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。

 

注意：

对于 t 中重复字符，我们寻找的子字符串中该字符数量必须不少于 t 中该字符数量。
如果 s 中存在这样的子串，我们保证它是唯一的答案。


来源：力扣（LeetCode）
链接：https://leetcode.cn/problems/minimum-window-substring
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 * </pre>
 * 
 * @author liupan
 * @date 2022年8月23日 上午9:57:50
 *
 */
public class Solution76 {

	Map<Character, Integer> wordMap = new HashMap<>();

	Map<Character, Integer> cnt = new HashMap<>();

	public static void main(String[] args) {
//		String s = "";
//		String t = "";

		String s = "ADOBECODEBANC";
		String t = "BANC";
		Solution76 sol = new Solution76();

		System.out.println(sol.minWindow(s, t));
	}

	/**
	 * 输入：s = "ADOBECODEBANC", t = "ABC" 输出："BANC"
	 * 
	 * @param s
	 * @param t
	 * @return
	 */
	public String minWindow(String s, String t) {

		for (char c : t.toCharArray()) {
			if (wordMap.containsKey(c)) {
				int value = wordMap.get(c) + 1;
				wordMap.put(c, value);
			} else {
				wordMap.put(c, 1);
			}
		}

		int left = 0;
		int right = -1;
		int min = Integer.MAX_VALUE;
		String res = "";

		while (right < s.length()) {
			right++;
			if (right < s.length() && wordMap.containsKey(s.charAt(right))) {
				char c = s.charAt(right);
				cnt.put(c, cnt.getOrDefault(c, 0) + 1);
			}

			while (check() && left <= right) {
				System.out.println(s.substring(left, right + 1));
				if (right - left + 1 < min) {
					min = right - left + 1;
					res = s.substring(left, right + 1);
				}
				// 再处理下一个左边,++以后check就不满足了
				if (cnt.containsKey(s.charAt(left))) {
					cnt.put(s.charAt(left), cnt.getOrDefault(s.charAt(left), 0) - 1);
				}
				left++;
			}
		}

		return res;
	}

	private boolean check() {
		Iterator iter = wordMap.entrySet().iterator();
		while (iter.hasNext()) {
			Map.Entry entry = (Map.Entry) iter.next();
			Character key = (Character) entry.getKey();
			Integer val = (Integer) entry.getValue();
			if (cnt.getOrDefault(key, 0) < val) {
				return false;
			}
		}
		return true;
	}

}
